import React from "react";

const Singup = () => {
  return (
    <div className="singup">
      <br></br>
      <h2>Registration : </h2>
      <input
        className="inputBox"
        type="text"
        placeholder="Enter the Name "
      ></input>
      <input
        className="inputBox"
        type="text"
        placeholder="Enter the Email"
      ></input>
      <input
        className="inputBox"
        type="text"
        placeholder="Enter the password"
      ></input>
    </div>
  );
};
export default Singup;
